Module["RecorderWebGL"].setCurrentConfig = function(options, microphone, ingameAudio, frameRate) {
	options = options !== 0 ? JSON.parse(UTF8ToString(options)) : undefined;
		
	Module["RecorderWebGL"].currentConfig = {
		options: options,
		microphone: microphone,
		ingameAudio: ingameAudio,
		frameRate: frameRate
	};
};

Module["RecorderWebGL"].save = function(fileName) {
	if (!Module["RecorderWebGL"].mediaRecorderBlob) return;
	const blob = Module["RecorderWebGL"].mediaRecorderBlob;
	fileName = fileName !== 0 ? UTF8ToString(fileName) : "file";
	
	if (fileName.indexOf(".") === -1) fileName = fileName + "." + blob.type.split(";")[0].split("/")[1];

	if (window.navigator.msSaveOrOpenBlob != null) {
		window.navigator.msSaveBlob(blob, fileName)
	} else {
		var link = document.createElement("a");
		link.download = fileName;
		link.style.display = "none";
		link.href = (window.URL ? URL : webkitURL).createObjectURL(blob);

		link.click();
		
		//setTimeout necessary for Safari
		setTimeout(function() {
		  (window.URL ? URL : webkitURL).revokeObjectURL(link.href);
		}, 1000);
	}
}

Module["RecorderWebGL"].toDataURL = function(callback) {
	var fr = new FileReader();
	fr.onload = function(e) {				
		var arr = e.target.result.split(";");
		var dataURL = e.target.result;
		if (arr.length === 3)
		  dataURL = arr[0] + ";" + arr[2];
		
		var bufferSize = lengthBytesUTF8(dataURL) + 1;
		var buffer = Module._malloc(bufferSize);
		stringToUTF8(dataURL, buffer, bufferSize);
		Module.dynCall_vi(callback, buffer);
	}
	fr.readAsDataURL(Module["RecorderWebGL"].mediaRecorderBlob);
};

Module["RecorderWebGL"].toObjectURL = function(callback) {
	var objectURL = (window.URL ? URL : webkitURL).createObjectURL(Module["RecorderWebGL"].mediaRecorderBlob);
	var bufferSize = lengthBytesUTF8(objectURL) + 1;
	var buffer = Module._malloc(bufferSize);
	stringToUTF8(objectURL, buffer, bufferSize);
	Module.dynCall_vi(callback, buffer);
};

Module["RecorderWebGL"].toByteArray = function(callback) {
	var fr = new FileReader;
	fr.onload = (function(e) {
		const byteArray = new Uint8Array(e.target.result);
        const buffer = _malloc(byteArray.length * byteArray.BYTES_PER_ELEMENT);
        HEAPU8.set(byteArray, buffer);
        Module.dynCall_vii(callback, buffer, byteArray.length);
        _free(buffer);
	});
	fr.readAsArrayBuffer(Module["RecorderWebGL"].mediaRecorderBlob);
};

